import React from 'react';
import './Sidebar.css';
import {Nav} from "react-bootstrap";
import { withRouter } from "react-router";
import * as FaIcons from 'react-icons/fa';


function Sidebar(){
    return (
    <>
        <div className = "sidebar">
            <Link to="#" className = "menu-bars">
                <FaIcons.FaBars/>
            </Link>
        </div>
    </>        
    )
}

export default Sidebar;
